import React from "react";

function Match() {
  const basicInfo = [
    "Team Number",
    "Auto Points",
    "Teleop Points",
    "Climb Level",
  ];
  const driveTrain_select = ["Mecanum Drive", "Swerve Drive", "Tank Drive"];
  const advancedInfo = [
    "Drive Motors",
    "Point Cons.",
    "Climb Cons.",
    "Starting Pos.",
  ];
  const startingPos_select = [
    "Position 1",
    "Position 2",
    "Position 3",
    "Position 4",
    "Position 5",
    "Position 6",
  ];
  return (
    <div className="container ">
      <br />
      <u>
        <small style={{ fontSize: "13px" }}>Basic Info</small>
      </u>
      {basicInfo.map((val, key) => {
        return (
          <>
            <div className="row">
              <div className="col-4" style={{ fontSize: "15px" }}>
                {val}
              </div>
              <div className="col-4">
                <div className="input-group">
                  <input
                    type="text"
                    className="input-control align-middle"
                    style={{ height: "30px", marginTop: "-5px" }}
                  />
                </div>
              </div>
            </div>
            <br />
          </>
        );
      })}
      <div className="row">
        <div className="col-4">Drive Train</div>
        <div className="col-4">
          <select name="" id="" style={{ width: "215px" }}>
            {driveTrain_select.map((value, key) => {
              return (
                <option value={key} id={key}>
                  {value}
                </option>
              );
            })}
          </select>
        </div>
      </div>
      <br />
      <u>
        <small style={{ fontSize: "13px" }}>Advanced Info</small>
      </u>

      {advancedInfo.map((val, key) => {
        return (
          <>
            <div className="row">
              <div className="col-4" style={{ fontSize: "15px" }}>
                {val}
              </div>
              <div className="col-4">
                <div className="input-group">
                  <input
                    type="text"
                    className="input-control align-middle"
                    style={{ height: "30px", marginTop: "-5px" }}
                  />
                </div>
              </div>
            </div>
            <br />
          </>
        );
      })}
    </div>
  );
}

export default Match;
